
      <head>
        <style>
          body {
            font-family: -apple-system,BlinkMacSystemFont,"Segoe UI","Roboto","Oxygen","Ubuntu","Cantarell","Fira Sans","Droid Sans","Helvetica Neue",sans-serif;
          }

          .page {
            position: relative;
          }

          .page-image {
            image-rendering: pixelated;
          }

          .log {
            z-index: 999;
            position: fixed;
            display: flex;
            flex-direction: column-reverse;
            overflow: auto;
            height: 150px;
            bottom: 0;
            right: 0;
            background-color: #ffffffcc;
            font-size: 1.2em;
            box-shadow: 0 0 5px #00000099;
          }

          .shape {
            position: absolute;
            min-height: 1px;
            min-width: 1px;
            opacity: 0.8;
          }

          .group {}

          .search--cutout {
            display: none;
          }
          .search.current .search--cutout {
            display: block;
          }
          .search--cutout:after {
            content: '';
            position: absolute;
            top: 0;
            left: 0;
            width: 100%;
            height:100%;
            box-shadow: 0px 0px 0px 99999px rgba(0,0,0,.8);
          }

          .search--test {
            display: none;
            background-color: #f542e3;
          }

          .search--added {
            display: none;
            background-color: #00ff00;
          }

          .contest-left-line .search--added {
            background-color: cyan;
          }
          .contest-right-line .search--added {
            background-color: magenta;
          }
          .contest-top-line .search--added {
            background-color: yellow;
          }
          .contest-bottom-line .search--added {
            background-color: salmon;
          }

          .search--added.reset {
            background-color: #666666;
          }

          .search.current .search--test,
          .search.current .search--added,
          .search.commit .search--added {
            display: block;
          }
        </style>
      </head>
